import { motion } from 'framer-motion';
import { useState } from 'react';
import { Link } from 'react-router-dom';
function Sidebars ({SiOuvert, setSiOuvert}) {
// Etat
const initial = {opacity:0, scale:0}
const animate = {opacity:1, scale:1}
const [IsPhone, setIsPhone] = useState(true)

  // Affichage

  return (
    <div className="">
      <motion.div
      className={`flex flex-col h-screen bg-gray-900 text-white relative transition-all duration-300 shadow ${
        SiOuvert ? 'lg:w-[20%] w-full' : 'lg:w-[5%] w-1/2'}`}
      initial= {{translateX:'-100%'}}
      animate = {{translateX:0}}
      transition={{duration:0.5}}
    >

        <div>
            <div className={`items-start text-center p-3 transition-all duration-300 ${
            SiOuvert ? 'text-3xl' : 'text-xl'
            }`}
            onClick={()=>setSiOuvert(true)}
            >
                {SiOuvert ? <motion.div initial={initial} animate={animate} duration={{duration:0.5, delay:1}} className='font-bold underline underline-offset-4'>Menu</motion.div> : <motion.i initial={initial} animate={animate} transition={{duration:0.5, delay:1}} className="text-5xl cursor-pointer fas fa-bars"></motion.i>}
                <hr />
            </div>
            <span className='absolute right-3 top-5' onClick={() => setSiOuvert(false)}>{SiOuvert && <i className='text-3xl cursor-pointer fas fa-xmark'></i>}</span>
        </div>

        {<motion.div 
          className="flex flex-col items-center justify-center w-full h-full"
          initial={initial}
          animate={animate}
          transition={{duration:0.5, delay:1.5}}
          >
            <Link to='/' className="relative w-full p-3 mb-4 text-xl text-center text-white no-underline rounded-lg cursor-pointer hover:bg-gray-700"><div><i className={`fas fa-chart-line text-2xl ${SiOuvert ? 'absolute left-4' : 'text-center'}`}></i> {SiOuvert && <span>Dashboard</span>}</div></Link>
            <Link to='/Ajouter' className="relative w-full p-3 mb-4 text-xl text-center text-white no-underline rounded-lg cursor-pointer hover:bg-gray-700"><div><i className={`fas fa-folder-plus text-2xl ${SiOuvert ? 'absolute left-4' : 'text-center'}`}></i> {SiOuvert && <span>Ajouter des tâches</span>}</div></Link>
            <Link to='/Liste' className="relative w-full p-3 mb-4 text-xl text-center text-white no-underline rounded-lg cursor-pointer hover:bg-gray-700"><div><i className={`fas fa-list-check text-2xl ${SiOuvert ? 'absolute left-4' : 'text-center'}`}></i> {SiOuvert && <span>Listes des tâches</span>}</div></Link>
            <Link to='/Fini' className="relative w-full p-3 mb-4 text-xl text-center text-white no-underline rounded-lg cursor-pointer hover:bg-gray-700"><div><i className={`fas fa-clipboard text-2xl ${SiOuvert ? 'absolute left-4' : 'text-center'}`}></i> {SiOuvert && <span>Tâche fini</span>}</div></Link>
            <Link to='/NonFini' className="relative w-full p-3 mb-4 text-xl text-center text-white no-underline rounded-lg cursor-pointer hover:bg-gray-700"><div><i className={`fas fa-clipboard-question text-2xl ${SiOuvert ? 'absolute left-4' : 'text-center'}`}></i> {SiOuvert && <span>Tâche non fini</span>}</div></Link>
        </motion.div>}

        <motion.div 
          className="items-end justify-center"
          initial={initial}
          animate={animate}
          transition={{duration:0.5, delay:2}}
        >
            <Link to='/Propos' className='text-white no-underline'><div className="relative w-full p-3 mb-4 text-xl text-center rounded-lg cursor-pointer hover:bg-gray-700"><i className={`fas fa-circle-question text-2xl ${SiOuvert ? 'absolute left-4' : 'text-center'}`}></i> {SiOuvert && <span>À propos</span>}</div></Link>
            <div className="relative w-full p-3 mb-1 text-xl text-center rounded-lg cursor-pointer hover:bg-gray-700"><i className={`fas fa-arrow-right-to-bracket text-2xl ${SiOuvert ? 'absolute left-4' : 'text-center'}`}></i> {SiOuvert && <span>Quitter</span>}</div>
        </motion.div>



    </motion.div>
    </div>
  )
}
export default Sidebars;
